import React from 'react'

export const table = ({ classes, headers, bodies }) => {
    
    const createColumns = () => {
        return `<tr>
            ${headers.map(head => `<th ${head.params} >${head.value}</th>`)}
        </tr>`
    }

    return (
        <Fragment>
        <table className={classes}>
            <thead>{createColumns()}</thead>
            <tbody>{bodies}</tbody>
        </table>
        </Fragment>
    )
}
